export const ExpenseWrapper = styled.div`
    padding: 1rem;
    background-color: rgb(31, 31, 31);
    margin: 2rem auto;
    width: 70%;
    max-width: 95%;
`;

export const Content = styled.p`
    color: red;
    text-align: center;
    font: inherit;
`;
